import React from "react";

import "./Projects.scss"

import { Outlet, Link} from "react-router-dom";

const Projects = () => {

    return (
        <div>
            <Link to="/projects" className="link">
                Projects
            </Link>
            <Outlet className="projects__wrapper"/>
        </div>
    )
}

export default Projects;
